import React from 'react';
import Overlay from '../components/Overlay';

const AboutPage = () => {
  const contentStyle = {
    position: 'relative',
    zIndex: 2,
    color: 'white',
    paddingTop: '20px', 
  };

  return (
    <div style={{ paddingLeft: '20px' }}>
      < Overlay />
      <div style={contentStyle}>
        <h1>About p-geolocation</h1>
        <p>
        The web app project revolves around the fascinating concept of determining one's geographical location based on two images of the sun. This innovative tool serves as a testament to the intersection of technology, image processing, and geolocation services. Users upload two images featuring the sun, and the application, through its sophisticated backend infrastructure, leverages image processing techniques to extract pertinent data.
        </p>
        <p>
          This project utilizes React JavaScript to create an interactive and dynamic user interface.
        </p>
        <p>
          Feel free to explore and enjoy using p-geolocation!
        </p>
      </div>
    </div>
  );
};

export { AboutPage };
